    false,nt"url": null,nt"notes": "In September 2013, WSI, a Quantum Spatial
    company (QSI), was contracted by the Puget Sound LiDAR Consortium (PSLC) to collect
    Light Detection and Ranging (LiDAR) data over three areas of interest (AOIs) in
    the greater Seattle, Washington area. The individual AOIs include the Cedar River
    Watershed and Floodplain, Lake Youngs Reservoir, and the SCL/Tolt Reservoir, herein
    all referred to as the Cedar Watershed LiDAR project. This metadata refers to the
    first delivery of many. Tiles were delivered as state plane orthometric x,y,z values
    but have since been reprojected/transformed to geographic, ellipsoidal coordinates
    for OCM use and storage. Original naming conventions will apply to the FTP available
    data. The average first-return density of LiDAR data for the Cedar Watershed LiDAR
    project was 1.15 points per sq. ft (12.41 points per sq m) while the average ground
    classified density was 0.25 points per sq. ft (2.67 points per sq m)",nt"owner_org":
